import React from 'react';

const style = `
    opacity: 0.8;

    figcaption {
        display: none;
    }
`;

const Disabled = (WrappedComponent: any) => {
    const randomNum = Math.floor(Math.random() * 100);
    return (props:any) => (
        <WrappedComponent style={style} {...props} randomNumber={randomNum}>{props}</WrappedComponent>
    );
};

export default Disabled;
